import React from 'react';
import ReactDOM from 'react-dom';
function Card(props){
    return(
<>
<div className='cards'>
        <div className='card'>
        <img src={props.imgsrc} alt="myPic" className='card_img'/>
            <div className='card-info'>
            <span className='class-category'>{props.title}</span>
            <h3 className='card-title'>{props.sname}</h3>
            <a href={props.link} target='blank'>
                <button>Watch Now</button>
            </a>
            </div>
        </div>
        </div>
        </>
    );
}
ReactDOM.render(
    <>
<Card imgsrc="https://m.media-amazon.com/images/M/MV5BYjIwOWYwMjktYzhlZS00ODg0LTgwZDYtYTY1MGQ3NGQ2YjIxXkEyXkFqcGdeQXVyMTQ4MDUxMTk1._V1_FMjpg_UX1000_.jpg" title="A Netflix original series" sname='Dark' link="https://www.netflix.com/in/title/81175265"/>
<Card/>
<Card/>
    </>
,
    document.getElementById("root")
